export default function Resume() {
  return (
    <div class="body">
      <h1>Resume</h1>
      <p>
        <a href="https://github.com/shannonjburris/react-portfolio/blob/main/Assets/Images/Shannon_Burris_Resume_Web.pdf" target="_blank" rel="noreferrer">Resume</a>
      </p>
      <iframe title="portfolio" src="https://drive.google.com/file/d/1ZWwu-5y8WgYUPILKSTKBDnZuk0HYHXKU/view" width="100%" height="500px">
    </iframe>
    </div>
  );
}
